message:
Bolsonaro, hoje às 20:18h

i) de branco, sinalizando PAZ;

ii) General Heleno do lado (EB);

iii) Afirmou: Denúncias foram Comprovadas e Ignoradas;

iv) Sugeriu participação dolosa do PT (militares não blefam, podemos presumir informações não apresentadas, mas existentes);

v) Inquérito Inconstitucional do STF/Fake News/Alexandre Morais;

vi) “Iremos às Últimas Conseqüências dentro da Constituição”.
